import React, { Component } from 'react';
import { Button } from '@material-ui/core';
import countapi from 'countapi-js';

export default class CounterButton extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			count: 0,
		};
	}

	render() {
		return (
			<Button 
	          color="primary" 
	          variant="outlined"
	          onClick={() => {
	            countapi.visits().then(result => console.log(result.value));
	          }}
	        >
	          Hello world
	        </Button>
		);
	}
}
